a solução correta.\",\"a11yRetry\":\"Tente de novo. Apagar todas as respostas e iniciar de novo.\",\"a11yCheckingModeHeader\":\"Modo de verificação\",\"confirmCheck\":{\"header\":\"Tentar novamente?\",\"body\":\"Tem a certeza de que pretende tentar novamente?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Terminar\"},\"confirmRetry\":{\"header\":\"Repetir ?\",\"body\":\"Tem a certeza que deseja repetir?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Confirmar\"},\"questions\":[\"<p>Os Descobrimentos *Portugueses* iniciaram-se na costa ocidental africana com a passagem do Cabo Bojador, em 1934, com *Gil Eanes*, numa barca de 30 tonéis,&nbsp;um só mastro, uma única vela *redonda/quadrada*, parcialmente coberta,&nbsp;movida a remos e com quinze homens.</p>\\n\\n<p>As viagens continuaram,&nbsp;*1497* data a viagem marítima de Vasco da Gama à Índia, seguido de *Pedro Álvares Cabral*, tendo este alcançado terras do *Brasil/Vera Cruz* em *1500: último ano do século XIV*.</p>\\n\\n<p>Fernão de *Magalhães*, em 1519, ao serviço dos reis de *Castela*, chegou ao Pacifico, provando a esfericidade da *terra*, foi morto na atual zona das Fiipinas e dos 265 homens, de várias nacionalidades, regressaram 18 ao porto de Sanlúcar em 1522.</p>\\n\\n<p>&nbsp;</p>\\n\"]}","library":"H5P.Blanks 1.14","contentUrl":".","metadata":{"license":"U","title":"Descobridores portugueses nos séculos XV e XVI","defaultLanguage":"en"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.j
